export class User {
    constructor(obj) {
      this.id = obj.id;
      this.username = obj.username;
      this.email = obj.email;
      this.firstName = obj.firstName;
      this.lastName=obj.lastName;
      this.birthday = obj.birthday;
      this.address = obj.address;
      this.type = obj.type;
      this.image = obj.image;
    }
  }